import React from 'react';
import { connect } from 'react-redux';
// import { Table, Button, Icon } from 'semantic-ui-react'
// import { get_data, get_file } from './../common/common_modules'
// import ReactToPrint from 'react-to-print'
import Barcode from 'react-barcode'
import logo from './../logo.svg';
import './disp.css';

class ComponentToPrint extends React.Component {
    render() {
      return (
          <div className='disp_print'>
              <div className='disp_print_header'></div>
              <div><img className="header_logo" src={logo} /></div>
              <div>{this.props.store.disp.data.RecCity}</div>
              <div><Barcode value={this.props.store.disp.data.Number} format='CODE39' width='1' height='30'/></div>
        </div>
      );
    }
  }



export default connect(
    state => ({
        store: state
    })

)(ComponentToPrint);
